private int arraysHashCode(Term[] termArray) {
    if (termArray == null)
        return 0;

    int result = 1;

    for (int i = 0; i < termArray.length; i++) {
      Term term = termArray[i];
      result = 31 * result + (term == null ? 0 : term.hashCode());
    }

    return result;
}

